import React from "react";
import FormItem from "./FormItem";
import styled from "./RendredList.module.css";
const RendredList = (props) => {
  // list of li element bassed in array from props
  return (
    <ul className={styled.listItem}>
      {props.onAddFormArr.map((elem) => {
        return <FormItem key={elem.key} name={elem.name} age={elem.age} />;
      })}
    </ul>
  );
};
export default RendredList;
